(43, 'Gathering Volunteer YSKB', 'Gathering yang diadakan sebagai suatu event dimana para volunteer dapat lebih mengenal satu dengan yang lain, dan sebagai bentuk apresiasi bagi mereka yang selama ini telah mendukung YSKB baik dengan doa, tenaga maupun dana  Gathering akan diadakan di: Lokasi: d''Java Resto, jl. Tegalsari 60, Surabaya Hari/Tanggal: Rabu / 16 Maret 2011 Pukul: 18.30 WIB (please be on time) Dresscode: Semi formal  Untuk memeriahkan suasana, akan diadakan acara tukar kado. Peserta dapat membawa kado dengan ketentuan sebagai berikut: 1. Harga kado minimal Rp. 10.000,- 2. Kado dibungkus dengan kertas koran  Karena tempat terbatas, anda dapat melakukan reservasi/pendaftaran lebih dulu dengan ketentuan sebagai berikut: 1. Bagi anda yang telah terdaftar sebagai volunteer YSKB sebelum 1 Maret 2011 dapat membeli undangan dengan harga Rp. 10.000,- / orang 2. Bagi anda yang terdaftar sebagai volunteer YSKB sejak tanggal 1 Maret 2011 keatas, dapat membeli undangan dengan harga Rp. 40.000,- / orang 3. Anak diatas usia 3 tahun membayar penuh * Validitas berdasarkan database volunteer kami  Untuk info, reservasi/pendaftaran dapat menghubungi:  Yayasan Sentuhan Kasih Bangsa Jl. Cempaka 25, Surabaya Selasa - Jumat pk. 09.30 - 16.00 Sabtu pk. 09.30 - 13.30 Minggu pk. 08.30 - 12.30 dan pk. 16.00 - 21.00  Pendaftaran terakhir hari Sabtu, 12 Maret 2011  Be there.. GBU      ', '2011-03-16', '2011-03-16', 'd''Java Resto, Jl. Tegalsari 60', 'Surabaya', '', ''),
