(51, 'How to CREATE SYSTEM Thats RUNS WITHOUT You', '<p>Sudah saatnya Bisnis Anda DAPAT BERJALAN TANPA Kehadiran Anda ..</p>\r\n<p><strong>Temukan cara PALING CEPAT Men SISTEMASI BISNIS dalam One Day Workshop :</strong></p>\r\n<p><strong>How to CREATE SYSTEM That RUNS WITHOUT You</strong></p>\r\n<p>Workshop ini akan menjawab Bagaimana CARA Anda :</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Meningkatkan profit&nbsp;<strong>tanpa iklan</strong>?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Meningkatkan profit&nbsp;<strong>hingga 179%?</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Menciptakan<strong>&nbsp;SISTEM</strong>&nbsp;yang dapat berjalan tanpa anda?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membuat&nbsp;<strong>SOP</strong>&nbsp;yang Mudah di Publikasikan?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membuat<strong>&nbsp;STANDARISASI PROSES KERJA</strong>&nbsp;agar hasil kerja setiap orang seragam?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membangun<strong>&nbsp;STRUKTUR ORGANISASI&nbsp;</strong>yang tepat guna?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membuat&nbsp;<strong>BUSINESS BLUEPRINT</strong>&nbsp;yang membuat Bisnis Anda bertahan 100 tahun ?</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Membuat&nbsp;<strong>BUDAYA PERUSAHAAN</strong>&nbsp;yang Tertanam Kuat ?</p>\r\n<p>&nbsp;</p>\r\n<p>7 Alasan mengapa Anda wajib hadir :<br />1. Metodenya sederhana</p>\r\n<p>2. Anda bisa memperbesar bisnis sesuai keinginan</p>\r\n<p>3. Anda diajar langsung oleh pakarnya</p>\r\n<p>4. Sudah digunakan oleh ratusan pengusaha di seluruh dunia</p>\r\n<p>5. Jika kompetitor Anda lebih gesit, Anda akan kalah cepat</p>\r\n<p>6. Menciptakan sistem yang dapat dengan mudah di implementasikan di bisnis Anda</p>\r\n<p>7.&nbsp; Menjalankan bisnis secara auto pilot</p>\r\n<p>&nbsp;</p>\r\n<p>Bersama :</p>\r\n<p><strong>ARYA ANJA</strong></p>\r\n<p>Relationship Coach Founder &amp; CEO Smart Coaching Indonesia</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>HERMAN JOSEP SOEWONO</strong></p>\r\n<p>PraktisiPenjualan&gt;18 thn | Director &amp; Sales Trainer of PRO-M</p>\r\n<p><em>&nbsp;</em></p>\r\n<p>Diselenggarakan pada :</p>\r\n<p><strong>Rabu, 6 September 2017 |&nbsp;</strong>Pk. 09.30 &ndash; 16.30 WITA</p>\r\n<p><strong>Hotel IBIS Style,&nbsp;</strong>Jl. Teuku Umar 183 Denpasar</p>\r\n<p><em>(brosur</em><em>&nbsp;terlampir</em><em>)</em></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>INVESTASI :</strong></p>\r\n<p><strong>Rp. 1.695.000,-/org&nbsp;</strong>atau</p>\r\n<p><strong>Rp. 1.195.000,-/org minim daftar 2 orang</strong></p>\r\n<p>Incl :Coffee Break, Lunch, Handout &amp; Certificate</p>\r\n<p>Biaya dapat ditransfer ke rek. BCA ac. 51 2020 2121 an. Fanny,&nbsp;<br />dan bukti transfer dapat diemail ke:&nbsp;<a class="__cf_email__" href="http://pro-m.net/cdn-cgi/l/email-protection" data-cfemail="1b7074756f7a705b6b6974367635757e6f">[email&nbsp;protected]</a>&nbsp;type="text/javascript" data-cfhash="f9e31"&gt;</p>\r\n<p><strong>PENDAFTARAN : PRO-M<br /></strong>Phone / SMS / WA :</p>\r\n<p>0811 333 9297 | 081 2300 2260<br /><a class="__cf_email__" href="http://pro-m.net/cdn-cgi/l/email-protection" data-cfemail="63080c0d1702082313110c4e0e4d0d0617">[email&nbsp;protected]</a>&nbsp;type="text/javascript" data-cfhash="f9e31"&gt; | www.pro-m.net</p>', '2017-09-06', '2017-09-06', 'Hotel IBIS Style Jl Teuku Umar 183', 'Denpasar', 'Robot-03-51.jpg', ''),
(52, 'Workshop', '<p>Apakah Anda mengalami Kesulitan utk Mengenali Karakter &amp; Kepribadian Rekan Bisnis, Tim Kerja &amp; Staff Anda? Ikuti&nbsp; One Day Workshop&nbsp;<strong>GRAFOLOGI :</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bagaimana</strong><strong>&nbsp;</strong><strong>Mengenal KARAKTER &amp; KEPRIBADIAN Rekan</strong><strong>&nbsp;</strong><strong>Bisnis, Relasi, Tim Kerja</strong><strong>&nbsp;</strong><strong>&amp;</strong><strong>&nbsp;</strong><strong>Staf</strong><strong>&nbsp;</strong><strong>Anda</strong><strong>&nbsp;</strong><strong>Melalui GRAFOLOGI (Membaca</strong><strong>&nbsp;</strong><strong>Tulisan</strong><strong>&nbsp;</strong><strong>Tangan)?</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Mutlak</strong><strong>&nbsp;diikuti</strong><strong>&nbsp;oleh :</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Owner &amp; Decision Maker</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; HRD, Manajerdan Marketing&nbsp; dari berbagai divisi</p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Conselor, Pengajar, dsb.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Manfaat</strong><strong>&nbsp;mengikuti workshop ini, Anda</strong><strong>&nbsp;akan</strong><strong>&nbsp;mengetahui :</strong></p>\r\n<ol>\r\n<li>Bagaimana cara mengenal rekan bisnis Anda, kecendurungan sifat bawah sadarnya, sehingga kita tahu sedang berhadapan dengan siapa saat ini ?</li>\r\n<li>Apa saja dasar-dasar untuk merekrut, seleksi, penempatan karyawan, jenis pekerjaan yang cocok &amp; pembentukan tim ?</li>\r\n<li>Bagaimana mengenal pasangan sebagai dasar berkomunikasi untuk membangun rumah tangga?</li>\r\n<li>Bagaimana mengenal sifat anak-anak sehingga dapat diarahkan sejak dini sesuai potensi yang dimilikinya ?</li>\r\n<li>Bagaimana mengenal diri sendiri sebagai upaya untuk meningkatkan kelebihan dan meminimalkan keterbatasan kita ?</li>\r\n<li>Bagaimana mengenal seseorang, termasuk didalamnya kejujuran, polapikir, kecenderungan agresi/kasar, optimis / pesimis, kelebihan &amp; kekurangan yang dimiliki, dll nya ?</li>\r\n<li>Apa yang Dapat kita lakukan setelah mengetahui kekurangan-kekurangan yang ada ?</li>\r\n</ol>\r\n<p>&nbsp;</p>\r\n<p><strong>Kita dapat</strong><strong>&nbsp;</strong><strong>mengetahuinya</strong><strong>&nbsp;</strong><strong>dengan</strong><strong>&nbsp;</strong><strong>cepat, hanya</strong><strong>&nbsp;</strong><strong>dengan</strong><strong>&nbsp;</strong><strong>membaca</strong><strong>&nbsp;</strong><strong>tulisan</strong><strong>&nbsp;</strong><strong>tangannya.</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Dilaksanakan Pada:</strong></p>\r\n<p><strong>Hari/tgl&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;</strong><strong>Jumat, 29 September 2017</strong></p>\r\n<p><strong>Waktu&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;</strong><strong>Pk. 09.00 &ndash; 17.00 WIB</strong></p>\r\n<p><strong>Temapat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :&nbsp;</strong><strong>Hotel Swiss Belinn</strong><strong>&nbsp;</strong><strong>Manyar</strong></p>\r\n<p><strong>Jl. Manyar</strong><strong>&nbsp;</strong><strong>Kertoarjo No. 100 Surabaya</strong></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Bersama :</strong></p>\r\n<p><strong>Celestine Clarence Yuliana, S.Psi</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Meraih</em><em>&nbsp;gelar Certified Handwriting Analyst (C.H.A) dari Authentic School of Graphology</em></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Meraih</em><em>&nbsp;gelar Certified Master Handwriting Analyst (CMHA) dari Dr. Erika Karohs Institute, USA.</em></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Meraih</em><em>&nbsp;gelar Certified Hypnotherapy dari Banyan Hypnosis Center for Training Minnesota, USA</em></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Master Hypnotist (MHt) dari National Guild of Hypnotists (NGH) USA.</em></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<em>Meraih</em><em>&nbsp;gelar Certified Behavioral Analyst dari Authentic School</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Investasi :</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Normal Price :&nbsp;Rp 2.850.000,-/org</strong></p>\r\n<p>-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>Special Price &nbsp; : Rp 2.350.000,-/org</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Hanya</strong><strong>&nbsp;</strong><strong>untuk 10 Pembayar</strong><strong>&nbsp;</strong><strong>Pertama :</strong></p>\r\n<p><strong>Rp. 1.950.000/org</strong><strong>&nbsp;</strong>(utk keikutsertaan minim 2 org)</p>\r\n<p>&nbsp;</p>\r\n<p>Termasuk :</p>\r\n<ol>\r\n<li>BONUS Report Talent Test senilai&nbsp;<strong>Rp. 500.000,-</strong></li>\r\n<li>BONUS Report Personality Test senilai&nbsp;<strong>Rp. 500.000,-</strong></li>\r\n<li>BONUS Report Learning Style Test senilai&nbsp;<strong>Rp. 500.000,-</strong></li>\r\n<li>Sertifikat</li>\r\n<li>Materi&amp; Tool Kit</li>\r\n<li>Lunch &amp; 2x Coffee Break</li>\r\n</ol>\r\n<p><strong>Total BONUS senilai</strong><strong>&nbsp;</strong><strong>Rp. 1.500.000,-</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Biaya ditransfer ke BCA Cab Prapen SBY a/c 51 2020 2121 a/n FANNY. Bukti transfer diemail ke&nbsp;</strong><a href="mailto:kontak@pro-m.net"><strong>kontak@pro-m.net</strong></a><strong>&nbsp;atau Fax (031) 841 4969</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>DIJAMIN SAMPAI BISA</strong></p>\r\n<p><strong>Peserta</strong><strong>&nbsp;</strong><strong>maks. 30 orang</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>TESTIMONI peserta :</strong></p>\r\n<p><strong>Sutresno</strong><strong>&nbsp;Kusmana (pengusaha &ndash; Surabaya)</strong></p>\r\n<p><em>&ldquo;DISC &amp;</em><em>&nbsp;Grapho</em><em>&nbsp;sangat</em><em>&nbsp;membantu</em><em>&nbsp;saya di bidang</em><em>&nbsp;pekerjaan. Sebagai owner, saya</em><em>&nbsp;dapat</em><em>&nbsp;membantu HRD untuk</em><em>&nbsp;mempersingkat</em><em>&nbsp;waktu</em><em>&nbsp;perekrutan</em><em>&nbsp;tanpa</em><em>&nbsp;mengandalkan</em><em>&nbsp;banyak</em><em>&nbsp;alat test.&rdquo;</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Jo Grace (pengusaha &ndash; Surabaya)</strong></p>\r\n<p><em>&ldquo;Saya</em><em>&nbsp;mampu</em><em>&nbsp;menambah</em><em>&nbsp;wawasan</em><em>&nbsp;untuk</em><em>&nbsp;mengenali</em><em>&nbsp;lawan</em><em>&nbsp;bicara</em><em>&nbsp;saya. Dalam</em><em>&nbsp;bidang</em><em>&nbsp;pekerjaan, saya</em><em>&nbsp;bias</em><em>dengan</em><em>&nbsp;mudah</em><em>&nbsp;berkomunikasi</em><em>&nbsp;dan</em><em>&nbsp;menata</em><em>&nbsp;tim</em><em>&nbsp;kerjasaya.&rdquo;</em></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Jenny Sugiharto (Komisaris Swiss Bell in Hotel Surabaya &amp; Director PT. Pondok</strong><strong>&nbsp;Tjandra Indah Group &ndash; Surabaya)</strong></p>\r\n<p><em>&ldquo;Ilmu</em><em>&nbsp;Grapho</em><em>&nbsp;sangat</em><em>&nbsp;penting</em><em>&nbsp;dalam</em><em>&nbsp;pekerjaan</em><em>&nbsp;saya. Saya</em><em>&nbsp;bias</em><em>&nbsp;mengetahui</em><em>&nbsp;karakter</em><em>&nbsp;dari</em><em>&nbsp;rekan</em><em>&nbsp;kerja</em><em>&nbsp;dan partner bisnis</em><em>&nbsp;saya.&rdquo;</em></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>PENDAFTARAN : PRO-M<br /></strong><strong>Hp/WA:&nbsp;</strong><strong>0812 300 2260</strong><strong>&nbsp;| Phone (031) 847 7000 | PIN BB: 5D87 5204<br />Email :&nbsp;kontak@pro-m.net&nbsp;| Website :&nbsp;</strong><a><strong>www.pro-m.net</strong></a></p>\r\n<p>&nbsp;thanks &amp; CU</p>', '2017-09-29', '2017-09-29', 'Hotel Swis Belinn Manyar', 'Surabaya', 'zombie4-52.png', '');
