(12, 3, '2017-08-30 09:17:44', 'Ortopedy', '<p>Smartphone Android apabila pengguna sering memakainya itu ibarat harta yang sangat berharga, karena yang sudah kita lihat bersama bahwa hp android itu bisa menyimpan file yang sifatnya rahasia. Bukan hanya itu saja melainkan apabila kita menjadi seorang pembisnis tentunya ada nomor &ndash; nomor penting yang harus kita jaga dengan baik, sehingga dengan inilah ponsel android menjadi alat yang sangat berpengaruh pada finansial seseorang sehingga memilki peran yang sangat besar.</p>', '<p>Smartphone Android apabila pengguna sering memakainya itu ibarat harta yang sangat berharga, karena yang sudah kita lihat bersama bahwa hp android itu bisa menyimpan file yang sifatnya rahasia. Bukan hanya itu saja melainkan apabila kita menjadi seorang pembisnis tentunya ada nomor &ndash; nomor penting yang harus kita jaga dengan baik, sehingga dengan inilah ponsel android menjadi alat yang sangat berpengaruh pada finansial seseorang sehingga memilki peran yang sangat besar.</p>\r\n<p>Sistem teknologi yang sudah semakin canggih tentunya membuat para pengguna ini selalu mencari smartphone android berkualitas yang mumpuni dalam aktivitas kita sehari &ndash; hari, namun tahukan Anda ketika dalam penggunaan yang tidak baik pada perangkat hp android itu akan berakibat fatal, sehingga yang akan terjadi pastinya sebuah penyesalan karena smartphone Anda menjadi rusak atau error. Oleh karena itu jika ponsel Anda mau awet dan tahan lama dalam performa kinerjannya sehingga tetap terjaga, yaitu jangan sering &ndash; sering melakukan hal seperti dibawah ini.</p>\r\n<p>1. Tidak mengunci smartphone</p>\r\n<p>Semakin sering melakukan aktifitas pada smartphone Anda, maka sudah pasti kerusakan akan datang dengan sendirinya walaupun tidak menjemputnya, terlebih lagi Anda lalai untuk mengunci ponsel android, sehingga apabila hal ini terjadi maka teman atau orang lain dapat mengakses semua yang ada pada&nbsp;<a href="http://atasiandroid.com/" target="_blank" rel="nofollow noopener noreferrer">hp android</a>&nbsp;milik Anda, jadi untuk keamanan mulai sekarang gunakan password pada saat membuka ponsel.</p>\r\n<p>2. Melakukan charger lewat USB</p>\r\n<p>Untuk melakukan pengisian daya pada saat kepepet pasti yang Anda lakukan adalah menggunakan charger sembarangan, harus Anda ketahui charger walaupun fungsi dan bentuknya sama itu memiliki settingan khusus, jadi jangan asal pakai charger yah. Nah, ada lagi yang tindakan yang menurut saya sangat fatal, yaitu melakukan proses pengisian baterai smartphone dengan mencolokan port USB ke CPU komputer.</p>\r\n<p>3. Tidak melakukan backup</p>\r\n<p>Apabila hidup Anda tergantung pada smartphone android, jadi mulai sekarang lakukanlah sebisa mungkin untuk membackup semua data guna untuk mengamankannya. Untuk melakukan backup data atau file yang ada pada ponsel android tidaklah sulit.</p>\r\n<p>4. Selalu menggunakan hp walaupun sudah status siaga</p>\r\n<p>Pada saat ini sering tersiar kabar bahwa baterai atau charger sering menjadi penyebab terjadinya smartphone android meledak, jadi mulai detik ini kami sarankan Anda hindari pengisian baterai di tempat yang panas, membiarkan baterai terkuras hingga nol (0) dan mengabaikan ponsel yang sudah terisi penuh. Karena banyak sekali pengguna yang sering melakukan hal ini pada smartphone android miliknya, jadi mulai sekarang hindari penggunaan yang tidak wajar yah kawan&hellip;</p>\r\n<p>Itulah yang dapat kami informasikan mengenai 4 hal kebiasaan yang harus dihindari apabila smartphone android milik Anda ingin tetap berkualitas. Sekian dari kami dan terimakasih.</p>', '2017-08-30', 1, 14, 1, 0, '12-dummy-image.jpg', ''),
(13, 3, '2017-08-30 09:19:36', 'Surgery', '<p>DR Tangi</p>', '<p>Smartphone Android memang selalu update setiap waktu dari mulai sisi pada sistem ataupun desainnya, terlebih lagi pada saat ini sistem android mengusung OS Nougat yang membawakan performa pada ponsel pintar menjadi lebih canggih dan berkualitas. Namun dengan perkembangan teknologi smartphone android yang terus menigkat tentu saja&nbsp;<a href="http://ramandroid.com/" target="_blank" rel="nofollow noopener noreferrer">harga hp android</a>baru menjadi mahal dan hp Android yang lama akan tersaingi kualitasnya.</p>\r\n<p>Karena hp baru harganya mahal pasti saja lebih memilih smartphone yang bekas namun berkualitas terbaik, akan tetapi jangan semabarang membeli ponsel bekas, karena yang namanya bekas tentunya saja sobat juga paham tentang hal itu. Maka dari itu kami disini ingin memberikan tips mengenai cara membeli hp Android bekas yang mempunyai kualitas terbaik, yang dirangkum dari Digitaltrends berikut ini selengkapnya.</p>\r\n<p>1. Membeli smartphone &ldquo;Refurbished&rdquo;</p>\r\n<p>Smartphone Refurbished adalah kondisi yang masih utuh walaupun statusnya sudah bekas namun untuk kualitasnya masih terbilang bagus. Sehingga dengan smartphone bekas ini sobat bisa membelinya karena sudah diperbaharui dan juga mempunyai garansi sehingga dapat mengurangi resiko yang tidak di inginkan pada ponsel tersebut.</p>\r\n<p>2. Beli smartphone bekas yang ada &ldquo;Sertificat Pre-owned Smartphone&rdquo;</p>\r\n<p>Sebenarnya sama saja dengan smartphone refurbished, dimana smartphone yang dijual dengan kondisi seperti ini yaitu sudah melalui beberapa tahap uji dan memiliki garansi dengan waktu tertentu. Namun, aksesoris smartphone android bekas dengan kondisi ini tidak begitu lengkap dan juga tidak begitu baik jika untuk di operasikan. Akan tetapi ponsel dengan status ini dijual dengan harga yang murah jika dibandingkan dengan kondisi refurbished.</p>\r\n<p>3. Membeli smartphone bekas milik orang lain</p>\r\n<p>Beli smartphone bekas yang sudah dipakai orang lain memang dijual dengan harga yang sangat murah dan jika membelinya dengan kondisi seperti ini maka akan menguntungkan Anda dan apabila kita bandingan dengan kondisi refurbished dan juga pre-owned itu masih mending yang seperti ini karena bisa ditawar dengan harga murah. Namun jikan Anda sedang membeli smartphone dengan kondisi seperti ini tentunya harus memperhatikan pada sisi spek dan histori ponsel tersebut.</p>\r\n<p>Dan jika membelinya via online belilah pada website yang sudah memiliki autoritas terbaik dan juga menyediakan pembayaran dengan rekening bersama (Rekber), atau apabila membeli langsung bertemu pemiliknya, pastikan periksa semua kestabilan kinerja smartphone mulai dari sinyal, telpon, layar sentuh dan keaslian hp android tersebut.</p>\r\n<p>4. Melihat bagian yang sangat penting</p>\r\n<p>Membeli smartphone yang bekas tentunya harus ada beberapa yang menjadi bidik perhatian pembeli diantaranya adalah jaringan telpon, internet dan juga lainnya. Selain itu juga harus memperhatikan bahwa jaringan tersebut bisa digunakan dengan kartu perdana dari provider lain dan pastikan bahwa tidak ada kerusakan ataupun cacat pada smartphone android bekas tersebut. Bukan hanya itu saja, melainkan harus mengetest apakah charger dan earphone sudah berfungsi dengan normal atau tidak.</p>\r\n<p>Itulah yang informasi mengenei tips membeli smartphone bekas yang berkualitas dan semoga saja dengan ulasan ini dapat memberikan manfaat untuk sobat pembaca. Sekian dari kami dan terimakasih.</p>', '2017-08-30', 1, 1, 1, 0, 'graduates-3.png', '4-tips-membeli-smartphone-android-bekas-yang-berkualitas');
INSERT INTO `page` (`id`, `judul`, `isi`, `url`) VALUES
(4, 'How to Order', '<h2><span style="font-family: arial,helvetica,sans-serif;"><strong>Pembelian bisa dilakukan langsung melalui Website dengan Cara:</strong></span></h2>\r\n<ol>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Pilih produk yang akan di beli dan klik <strong>BELI</strong>. barang yang anda beli akan masuk ke keranjang belanja.</span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Setelah selesai belanja klik <strong>CHECKOUT </strong>di keranjang belanja.</span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Isi data pemesan, apabila menghendaki penerima barang tersebut berbeda, beri tanda check/centang pada "<strong>Apakah data penerima berbeda dengan pemesan?"</strong></span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Proses pembelian sudah selesai, silahkan tunggu SMS/Email konfirmasi pemesanan dari kami mengenai info rekening dan total pembelanjaan + ongkos kirim.</span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Lakukan pembayaran ke rekening kami.</span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Konfirmasikan pembayaran anda melalui SMS/Email dengan format: NAMA#NOMORORDER#JUMLAHTRANSFER#BANKTUJUAN</span></li>\r\n<li><span style="font-family: arial,helvetica,sans-serif;">Selesai..!!!! Silahkan tunggu kurir mengantar barang anda :)</span></li>\r\n</ol>\r\n<p>&nbsp;</p>', ''),
(7, 'About Us', '<table class="table-default" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="51%">&nbsp;<img src="https://fiesto.com/temp/jone/file/media/source/about1.jpg" alt="about1" /></td>\r\n<td>&nbsp;</td>\r\n<td style="text-align: center;" width="45%"><span style="font-size: 18pt;"><strong>We create high class artificial stones, laboratory grown, simulated diamonds.&nbsp;Let you realize the freedom of jewelry.</strong></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class="table-default" width="100%">\r\n<tbody>\r\n<tr>\r\n<td style="text-align: center;" width="45%"><span style="font-size: 18pt;"><strong>&ldquo;Don&rsquo;t Wait to Special Occasion to Wear Nice Jewellery, Every Day Is Special Occasion.&rdquo;</strong></span></td>\r\n<td>&nbsp;</td>\r\n<td width="51%">&nbsp;<img src="https://fiesto.com/temp/jone/file/media/source/about2.jpg" alt="about1" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', ''),
