INSERT INTO `template_option` (`id`, `judul`, `template`, `maxdimension`, `url`, `title`) VALUES
(1, 'Service 1', '<table><tbody><tr><td width="40%"><h2>THESOUTHERNSKY</h2><h3>The Leading Style Trendsetter</h3><p>Established in 2011, TheSouthernSky operates on two planes - a multifunctional lifestyle brand for both men and women, and a progressive retail establishment. We offer an array of premium products, ranging from our own in-house label to a curated selection of multi-brand apparel. Our brand has also extended to two shop-in-shops at Jakarta and Surabaya.</p><p><a class="btn btn-default more" href="http://localhost/iwd/demotoko/catalog">view product</a></p></td><td width="60%"><img src="http://localhost/iwd/masterpaket/file/media/source/home-image.png" alt="home-image" /></td></tr></tbody></table>', '', '', ''),
(2, 'Service 2', '<h4><strong>Produk Berkualitas<br /></strong></h4>\r\n<p>Dengan harga yang bersaing, kualitas barang yang baik menjadikan Michelle Baby Collection tempat untuk keperluan bayi anda.</p>', '', '', ''),
