(4, 'Footer 1', '<ul class="list-inline">\r\n<li><img src="http://localhost/iwd/demotoko/file/media/source/ico8.png" alt="ico8" />&nbsp;<a href="#">@playart.id</a></li>\r\n<li><a href="https://www.instagram.com/newbabysingapore/"><img src="http://localhost/iwd/demotoko/file/media/source/ico9.png" alt="ico9" /></a>&nbsp;<a href="#">playart id</a></li>\r\n</ul>', '', '', ''),
(5, 'Footer 2', '<h4><strong>Produk Berkualitas</strong></h4>\r\n<p>Dengan harga yang bersaing, kualitas barang yang baik menjadikan Michelle Baby Collection tempat untuk keperluan bayi anda.</p>', '', '', ''),
