INSERT INTO `testimonial` (`id`, `nama`, `komentar`, `status`, `tanggal`, `filename`, `ishot`) VALUES
(1, 'Craig M., ', '<p>With sincerest appreciation, thank you for all that you for all that you did to make our trip to Bali and Borobudur (Yogyakarta) so enjoyable. From the hotels to the guides, we could not have been taken care of better.</p>', 1, '2013-05-27 10:10:08', 'jogja-3.jpg', 1),
(2, 'Xiang L., Boston', '<p>Our trip was FANTASTIC!!! Thank you so much for your thoughtful planning tailored to our needs and wants, and making our trip such a worry-free vacation in a foreign country. Everything flowed seamlessly from the time we arrived until we flew back to the States. Everyone we encountered was so nice and helpful. Our Bali trip started with a wonderful stay at The Villa where we swam in our private pool under the moon and also in the rain. Massage was&nbsp;a true value, relaxing and eased away ou', 1, '2013-05-27 10:10:08', '350SQXiangYuenBesakih-8.jpg', 1),
(3, 'Client review', '<p>See client reviews on:</p>\r\n<table border="0">\r\n<tbody>\r\n<tr>\r\n<td><a title="Yelp" href="http://www.yelp.com/biz/doyantravel-yardley" target="_blank"><img src="/file/media/e0bcd848f6ae4cf9d8078c3ec2094f20.png" alt="logo" width="111" height="58" /></a></td>\r\n<td>\r\n<p><a title="Yahoo! Local" href="http://local.yahoo.com/info-65942614-doyantravel-yardley" target="_blank"><img src="/file/media/24728fb21929749cff7241f82b9ec09e.jpg" alt="yahoo local" width="120" height="43" /></a></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>', 1, '2013-05-27 10:10:08', '410DoyatravelLogo-11.jpg', 1),
(4, 'Lin S., Surprise, AZ', '<p>Our trip was fantastic. We have travelled to more than seventy countries and used many travel agencies. Doyan is by far the best agency and Weni is certainly the best travel agent. Weni was very thorough and went over in detail exactly what we wanted to see and do. When the plans were complete she again contacted us and went over in detail every aspect of the trip. Our trip went off without a problem and we know that Weni and her assistants attention to detail was the reason. I would recommen', 1, '2013-05-27 10:10:08', '350SQSloanWKomodo-9.jpg', 1),
(5, 'Mark R., California', '<p>My wife &amp; I chose DOYANTravel to arrange our honeymoon to Bali &amp; boy were we glad we did. We had no stress and had a great time. Importantly we got a great value for the money. Thanks! FIVE STARS!</p>\r\n<p>My wife &amp; I chose DOYANTravel to arrange our honeymoon to Bali &amp; boy were we glad we did. We had no stress and had a great time. Importantly we got a great value for the money. Thanks! FIVE STARS!</p>', 1, '2013-05-27 10:10:08', 'SQayana_wedding01-4.jpg', 1),
(6, 'Marie M., Indiana', '<p><span style="font-size: small;">I am glad Weny recommended going to Yogjakarta as we loved seeing both the Hindu and Buddhist temples. Our trip to Bali and Yogyakarta was absolutely great. We had excellent driver guides. The hotel choices were exactly what we were looking for, and the whole trip went very smoothly. Weni was very responsive and took care of every detail to perfection.&nbsp; Please recommend her company to anyone asking for advice. We would use Weni''s services again without any', 1, '2013-05-27 10:10:08', '410SQMask-5.jpg', 1),
(7, 'Chris J., La Quinta, CA', '<p>We&rsquo;ve just returned from a week in Bali arranged by DOYANtravel. We have no regrets, as we feel that the cost was worthwhile. Very educated and knowledgeable guide we had assigned to us from Airport pick up to Airport Drop off. He carried a little chair for me during our walks as I had hurt my back, and recommended and bought us little treats based on our interests and conversations. He was punctual, enthusiastic, and forthcoming with Balinese history and art. Our guide provided us with', 1, '2013-05-27 10:10:08', '350SQSteveW2Balinese-10.jpg', 1),
